import React from 'react';
import Container from './Container.js'
import SmallContainer from './SmallContainer.js'
import Header from './Header'
import H1 from './H1'
import Button from './Button'
import P from './P'
import Input from './Input'
import Br from './Br'



class Create extends React.Component {
	constructor(props) {
		super(props)
		this.state = {
			id: 0,
		}
	}

	render() {
		return(
			<Container>
				<Header width='100'>
					<H1 big>Create</H1>
					<SmallContainer width='150'><Br></Br></SmallContainer>
					<P big>Don't be a stat sheet. Be a hero.</P>
				</Header>

				<SmallContainer width='200'>
					<P big>Who will the legends speak of?</P>
					<Input placeholder='Character Name'></Input>
					<Button>fuck.</Button>
				</SmallContainer>
			</Container>
		);
	}

}

export default Create;
